INSERT INTO `quest_offer_reward` (`ID`, `Emote1`, `Emote2`, `Emote3`, `Emote4`, `EmoteDelay1`, `EmoteDelay2`, `EmoteDelay3`, `EmoteDelay4`, `RewardText`, `VerifiedBuild`) VALUES
(85244, 6, 0, 0, 0, 0, 0, 0, 0, 'We did it! Hah! \n\nThat\'ll show the world not tae mess with us! \n\nAnd tae never try stealin\' me hat again! \n\nAh... it feels so good tae have ye back. \n\nHere. Take me spare hat. It didn\'t feel right tae wear it while the other one was missin\'.', 61967), -- Defeating the Underpin
(82706, 1, 0, 0, 0, 0, 0, 0, 0, 'Got tae see some nice places today. That\'s always good. Gets the ol\' heart pumpin\'.', 61967), -- Delves: Worldwide Research
(91033, 0, 0, 0, 0, 0, 0, 0, 0, 'Their behavior seems mostly unchanged. This is very frustrating. Also if yer data is correct, it looks like they might be calmin\' down. \n\nWe will have tae see if this observation is true. And here is some additional gear that we have collected. I hope it has served ye well over the course of our scientific endeavors!', 61967), -- Monitoring 'Construct'ing
(91031, 0, 0, 0, 0, 0, 0, 0, 0, 'The data from defeatin\' that big construct provided what I needed for another upgrade. But this is the last upgrade we can do for the belt, unless we want a major meltdown. Of course a meltdown would tell us a lot about the design...\n\nMa always said, \"Dagran! If yer gonna destroy ancient, irreplaceable artifacts, destroy yer own.\" So this is the last upgrade.\n\nHere is the last upgrade card and another supply pack.', 61967), -- Pushing it to the Limit
(84370, 0, 0, 0, 0, 0, 0, 0, 0, 'Astounding! This is what I\'ve been missing. \n\nThe map Finley found is a cipher. But this key, it\'s incomplete... If you find any more out there, please bring them to me. I will decipher this map, or my name isn\'t Elise Starseeker.', 61967), -- The Key to Success
(87419, 1005, 0, 0, 0, 0, 0, 0, 0, 'There are fewer shadows in the world thanks to your efforts.', 61967), -- Worldsoul: Delves
(87554, 3, 0, 0, 0, 0, 0, 0, 0, 'Wow. Just...wow. I thought you were a goner for a second there, then I realized it was all an act for you. You get it.\n\nTake care of yourself, $N. And if you ever wanna stop saving the world, you\'ll have a bright future in showbiz.', 61609), -- Week 6: It's the Finale!
(87553, 3, 0, 0, 0, 0, 0, 0, 0, 'Loved the act, $N. Here\'s your prize purse.\n\nDid I see you drink a Can of Amps during the fight? Thanks! Way to get that product placement on camera!', 61609), -- Week 5: Another Amazing Week!
(87552, 3, 0, 0, 0, 0, 0, 0, 0, 'You fight with style! You should practice your autograph -- I hear some of the viewers are forming a fan club around you.', 61609), -- Week 4: They've Heard of You
(87551, 3, 0, 0, 0, 0, 0, 0, 0, 'I like your style! Here\'s your prize, and a little something extra for advertising the show.', 61609), -- Week 3: Spread the Word
(87550, 3, 0, 0, 0, 0, 0, 0, 0, 'I was right, right? The fans went wild! You\'re really earning a name for yourself!', 61609), -- Week 2: We're Really Taking Off
(91038, 1, 0, 0, 0, 0, 0, 0, 0, 'We appreciate your interest in aiding us.\n\nShards of our timeline have made their way into your world. It is a place more grim and dark than your own, where some villains became heroes and some heroes never had the chance.\n\nHelp us locate these hellish fragments out of time and return them to their rightful place, and we will provide you with armors tempered by the fires of our world.\n\nAnd should you find any Treasure Goblins that lurk in your world, we implore you to slay the abominations.', 61609), -- Hellhunters Wanted
(89263, 1, 0, 0, 0, 0, 0, 0, 0, 'You $p? Got something for you.', 61609), -- Your Cut of the Spoils
(89039, 1005, 0, 0, 0, 0, 0, 0, 0, 'Thanks, pal. Undermine is a mess right now. We\'ll take all the help we can get.\n\nAnd hey, a deal\'s a deal. Here\'s what we owe.', 61609), -- Turbo-Boost: Powerhouse Challenges
(91035, 0, 0, 0, 0, 0, 0, 0, 0, 'Wow! Tha\' drop off is huge. If this holds steady, these constructs could be gone soon! \n\nWe still don\'t know what prompted them to come out! What if we never know? I hope that they return.\n\nOh, no! I don\'t want them tae mess things up. I just hate tae leave this unsolved. \n\nAt least we will be more prepared if we do see them again. Thank ye for yer help, $n. I\'ve checked the numbers and yer belt should still work, even if the constructs do retreat. \n\nAnd one last box of supplies for yer help.', 61967), -- Construct De-Escalation
(91026, 0, 0, 0, 0, 0, 0, 0, 0, 'Here, yes... With these items I can make some final tweaks. And adding this directive...\n\nAh! That should do it. If you insert this into yer durable information storage container, it should update the effectiveness of the device\'s, um... effects. \n\nI was able to gather a few more items that should help ye on yer future excursions.', 61967), -- Gathering an Upgrade
(91009, 595, 0, 0, 0, 0, 0, 0, 0, 'Let me see. Yes! The device is powered on. \n\nOkay... If I just start the initialization sequence... and it\'s up. There are already two discs inside. And the menu will list areas where other miniature titan discs can be found. I\'m thinkin\' I can improve the device, but I need time. Find me later and see. \n\nOh--before ye go. I was able to gather a few extra items that should help ye on yer future excursions.', 61967), -- Durable Information Storage Container
(90971, 0, 0, 0, 0, 0, 0, 0, 0, 'My remote console shows that there was a change. The overcharged console is funnelin\' excess energy to a new node. This should grant ye that node\'s power when venturin\' intae other areas where the titan constructs have emerged.\n\nWe\'ll use the titan force\'s own energy against \'em!', 61967), -- Overcharged Console
(55499, 1, 1, 273, 0, 0, 300, 300, 0, 'The Age of Order shaped much of Draenor\'s future in many timelines. With each new artifact we find, we learn more about their development and demise, the commonalities and dissonances between each branch.$b$bThis artifact is the most peculiar of all. You did well to bring it to me.', 61609), -- The Shimmering Crystal
(80670, 1, 0, 0, 0, 0, 0, 0, 0, 'You have big talent for causing good trouble! Good good!\n\nTake these!', 61609), -- Eyes of the Weaver
(80592, 1, 0, 0, 0, 0, 0, 0, 0, 'May your chosen patron favor you, as you have them.', 61609), -- Forge a Pact
(89223, 1, 1, 273, 0, 0, 300, 300, 0, 'A remnant of Azeroth from a time of conflict and strife. Such a troubled artifact has no place in the timeways, thank you for returning it.', 61967), -- Remnant of Azeroth
(91030, 0, 0, 0, 0, 0, 0, 0, 0, 'Hmm, as I suspected. Yes... I need to adjust this here... done.\n\nThe good news is that this upgrade will nae make yer belt explode! I thought there was a small chance, but no longer. Yer data proved that I set the power too high. So... good thing I had ye do tha\' extra check, right?\n\nAs last time, the group here put together another package to help ye out.', 61967), -- New Titan Directives
(83738, 6, 0, 0, 0, 0, 0, 0, 0, 'Keep up the good good!\n\nThe Weaver also asks us to give you her \"compliments,\" but I find no \"compliments\" in here.\n\nMaybe I ate them? Apologies!', 61967), -- Notorious with The Weaver
(90970, 0, 0, 0, 0, 0, 0, 0, 0, 'Did ye find the shards? While ye were away, I remembered I\'d found some on my visit to that location. Ye should find them in a pouch I hid next to the console.', 61967), -- Titan Disc-Count
(90969, 0, 0, 0, 0, 0, 0, 0, 0, '$n, these consoles are bein\' overloaded by the titan\'s presence. If we can defeat them and secure titan discs, I think we can use \'em to empower the console to grant ye boons within the space. The boons can aid you in pushing back these rogue titan constructs.', 61967), -- Titan Consoles
(87356, 0, 0, 0, 0, 0, 0, 0, 0, 'Honor the Azj-Kahet flame.', 61609), -- Honor the Flame
(87355, 0, 0, 0, 0, 0, 0, 0, 0, 'Honor the Hallowfall flame.', 61609), -- Honor the Flame
(87357, 0, 0, 0, 0, 0, 0, 0, 0, 'Honor the Ringing Deeps flame.', 61609), -- Honor the Flame
(87342, 0, 0, 0, 0, 0, 0, 0, 0, 'Honor the Isle of Dorn flame.', 61609), -- Honor the Flame
(88808, 1, 0, 0, 0, 0, 0, 0, 0, 'I knew I could trust in you to complete such a feat.', 61609); -- A Scarred Journey Through Time
