(84370, 0, 0, 0, 0, 'This map makes no sense... Champion! Good tidings I hope?', 0), -- The Key to Success
(91033, 0, 0, 0, 0, 'Were ye able tae find out more?', 61967), -- Monitoring 'Construct'ing
(91031, 0, 0, 0, 0, 'I cannae wait to see if I was correct!', 61967), -- Pushing it to the Limit
(91030, 0, 0, 0, 0, 'I can\'t wait to see the data!', 61967), -- New Titan Directives
(91026, 0, 0, 0, 0, 'Do ye have the items?', 61967), -- Gathering an Upgrade
(87554, 0, 0, 0, 0, 'Don\'t lose your nerve on me now. Speak with Xyggie Marou and get in there!', 61967), -- Week 6: It's the Finale!
(87553, 0, 0, 0, 0, 'Speak with Xyggie Marou sign up for another match. Strike fear into your foes!', 61967), -- Week 5: Another Amazing Week!
(87552, 0, 0, 0, 0, 'Speak with Xyggie Marou to sign up for a fourth week match.', 61967), -- Week 4: They've Heard of You
(87551, 0, 0, 0, 0, 'Don\'t forget to use your banner inside the area. Your opponents will hate it, but the fans will love it!', 61967), -- Week 3: Spread the Word
