INSERT INTO `page_text` (`ID`, `Text`, `NextPageID`, `PlayerConditionID`, `Flags`, `VerifiedBuild`) VALUES
(9952, 'Ahoy there! A star member of my crew asked me to pass these shinies along to you. Keep an eye out for my mates in your fancy cities, they\'ll take them and offer you something real nice.', 0, 0, 0, 61609), -- 9952
(9275, '<On close inspection, you can decipher an encoded message expertly woven into the patterns of the silk.\n\nIt tells of all of the bribes taken by General Anub\'azal over his long and heroic career. The war machine runs on gold and greased tendrils, after all, as well as silk.>', 0, 0, 0, 61967); -- 9275
